// ----------------------------------------------------------------------------

int getSWNum(volatile int* SW_ptr, int orig) {
  int sw = *SW_ptr;
  if (sw & 0x200) return 0;
  if (sw & 0x100) return 1;
  if (sw & 0x80) return 2;
  if (sw & 0x40) return 3;
  if (sw & 0x20) return 4;
  if (sw & 0x10) return 5;
  if (sw & 0x8) return 6;
  if (sw & 0x4) return 7;
  if (sw & 0x2) return 8;
  if (sw & 0x1) return 9;
  return orig;
}

int getKEYPress(volatile int* KEY_ptr) {
  int key = *(KEY_ptr + 3);
  if (key & 0b1000) {
    *(KEY_ptr + 3) = key | 0b1000;
    return 3;
  }
  if (key & 0b100) {
    *(KEY_ptr + 3) = key | 0b100;
    return 2;
  }
  if (key & 0b10) {
    *(KEY_ptr + 3) = key | 0b10;
    return 1;
  }
  if (key & 0b1) {
    *(KEY_ptr + 3) = key | 0b1;
    return 0;
  }
  return -1;
}

bool checkLegalShipPlacement(GameState* gameState, int turn, Ship* ship) {
  bool valid = true;
  if (ship->vertical) {
    if (ship->row + ship->size > BOARDSIZE) ship->row = BOARDSIZE - ship->size;
    for (int i = 0; i < ship->size; i++) {
      if (gameState->shipboard[turn][ship->row + i][ship->col] != NOSHIP) {
        // call a function to highlight overlapping square
        valid = false;
      }
    }
  } else {
    if (ship->col + ship->size > BOARDSIZE) ship->col = BOARDSIZE - ship->size;
    for (int i = 0; i < ship->size; i++) {
      if (gameState->shipboard[turn][ship->row][ship->col + i] != NOSHIP) {
        // call a function to highlight overlapping square
        valid = false;
      }
    }
  }
  return valid;
}

int main() {
  volatile int* SW_ptr = 0xFF200040;
  volatile int* KEY_ptr = 0xFF200050;
  while (1) {
    // call function to draw title screen
    draw_title_screen();

    while (getKEYPress(KEY_ptr) != 3) {
      continue;
    }
    GameState* gameState = createGameState();
    if (!gameState) break;

    draw_background(gameState);

    int shipToPlace = 0;
    int turn;
    bool need_to_draw = true;

    // call function to draw the game screen (ship positioning stage)

    while (gameState->placementRound) {

        if(need_to_draw == true){
            draw_placement_game_board(gameState, shipToPlace+1);
            need_to_draw = false;
        }

      // players take turns placing ships
      turn = gameState->player1turn ? 0 : 1;
      Ship* ship = gameState->playerships[turn][shipToPlace];

      int key = getKEYPress(KEY_ptr);
      if (key == 3) {
        gameState->colsel = !(gameState->colsel);
        need_to_draw = true;
        }
      if (key == 2) {
        ship->vertical = !(ship->vertical);
        checkLegalShipPlacement(gameState, turn, ship);
        need_to_draw = true;
      }
      if (gameState->colsel) {
        int old_ship_col = ship->col;
        ship->col = getSWNum(SW_ptr, ship->col);
        if(ship->col != old_ship_col){
            checkLegalShipPlacement(gameState, turn, ship);
            need_to_draw = true;
        }
      } else {
        int old_ship_row = ship->row;
        ship->row = getSWNum(SW_ptr, ship->row);
        if(ship->row != old_ship_row){
            checkLegalShipPlacement(gameState, turn, ship);
            need_to_draw = true;
        }
      }

      if (key == 1 && checkLegalShipPlacement(gameState, turn, ship)) {
        if (ship->vertical) {
          for (int i = 0; i < ship->size; i++) {
            gameState->shipboard[turn][ship->row + i][ship->col] = shipToPlace;
          }
        } else {
          for (int i = 0; i < ship->size; i++) {
            gameState->shipboard[turn][ship->row][ship->col + i] = shipToPlace;
          }
          
        }
        need_to_draw = true;
        shipToPlace++;
        if (shipToPlace == 5){
            if (gameState->player1turn){
                gameState->player1turn = false;
                shipToPlace = 0;
            } else {
                gameState->player1turn = true;
                gameState->placementRound = false;
            }
        }
      }
      
    }

    need_to_draw = true;

    while (!(gameState->gameOver)) {
        if(need_to_draw == true){
            draw_game_board(gameState);
            need_to_draw = false;
        }

      // players take turns shooting each other's ships
      // draw ships if player wants to see, hide otherwise
      turn = gameState->player1turn ? 0 : 1;
      int notTurn = turn ? 0 : 1;
      int key = getKEYPress(KEY_ptr);
      if (key == 3) gameState->colsel = !(gameState->colsel);
      if (key == 2) {
        if (turn == 0) {
            gameState->ships1visible = !(gameState->ships1visible);
        } else {
            gameState->ships2visible = !(gameState->ships2visible);
        }
        need_to_draw = true;
      }
      if (gameState->colsel) {
        int old_game_col = gameState->col;
        gameState->col = getSWNum(SW_ptr, gameState->col);
        if(gameState->col != old_game_col){
            need_to_draw = true;
        }
      } else {
        int old_game_row = gameState->row;
        gameState->row = getSWNum(SW_ptr, gameState->row);
        if(gameState->row != old_game_row){
            need_to_draw = true;
        }
      }
      if (key == 1 &&
          gameState->shotboard[turn][gameState->row][gameState->col] ==
              UNKNOWN) {
        int shotResult =
            gameState->shipboard[notTurn][gameState->row][gameState->col];
        if (shotResult == NOSHIP) {
          gameState->shotboard[turn][gameState->row][gameState->col] = MISS;
        } else {
          gameState->shotboard[turn][gameState->row][gameState->col] = HIT;
          Ship* ship = gameState->playerships[notTurn][shotResult];
          ship->life--;

          // call a function to draw ships left or ships shot, something to
          // indicate game progress

          if (ship->life == 0) {
            gameState->playerlife[notTurn]--;
            if (gameState->playerlife[notTurn] == 0) {
              gameState->gameOver = true;
              gameState->player1win = gameState->player1turn;
            }
          }
        }
        gameState->player1turn = !(gameState->player1turn);
        need_to_draw = true;
      }
    }

    if (gameState->player1win) {
      // draw victory screen for player 1
    } else {
      // victory for player 2
    }

    while (
        getKEYPress(KEY_ptr) ==
        -1) {  // create a loop until player presses button to start next game
      continue;
    }

    deleteGameState(gameState);
  }

  return 0;
}